export default function Home() {
  return (
    <div>
      <h1>Home Page</h1>
        <h1>This is home page</h1>
        <h1>Welcome</h1>
        <h2>Good Morning. . . </h2>
        <h3>HAve a good day</h3>
    </div>
  )
}
